import React, { Component } from 'react'
import {Jumbotron} from 'react-bootstrap';

class JumbotronComp extends Component {
    render() {
        return (
            <Jumbotron className="text-center bg-lite ">
                <h2>Hello React</h2>
            </Jumbotron>
        )
    }
}
export default JumbotronComp;
